export class AdminDashboardComponent {
  constructor(route, router, fb, activatedRoute, api, observables) {
    this.route = route;
    this.router = router;
    this.fb = fb;
    this.activatedRoute = activatedRoute;
    this.api = api;
    this.observables = observables;
    this.host = environment.host;
    this.loggedUserInfo = null;
    this.myVendors = [];
    this.myVendorsTemp = [];
    this.popoverIndex = '';
    this.showSpinner = true;
    this.iterator = new Subject();
    this.communities = [];
    this.modalStatus = false; // Assign the data to the data source for the table to render

    this.loggedUserInfo = this.api.userInfo; // console.log("asd==1",this.loggedUserInfo)

    this.userInfoSubscriber = this.api.userInfoStatus.subscribe(res => {
      this.loggedUserInfo = res; // console.log("asd=home=",this.loggedUserInfo)

      if (this.loggedUserInfo.video_status == 0) {
        this.modalStatus = true;
        this.api.send("updateDb", {
          table: 'users',
          data: {
            video_status: 1
          },
          conditions: [{
            user_id: this.loggedUserInfo.user_id
          }]
        });
      }

      this.getMyVendors();
      this.getCommunity();
    }); // console.log("adminnnn==", this.loggedUserInfo)

    if (this.loggedUserInfo) {
      this.getMyVendors();
      this.getCommunity();
    }

    this.searchSubscriber = this.api.searchTerm.subscribe(searchTerm => {
      // console.log("Searchig For==",searchTerm)
      if (searchTerm.length > 0) {
        this.myVendors = this.myVendorsTemp.filter(item => {
          return item.company_name.toLowerCase().startsWith(searchTerm.toLowerCase());
        });
      } else {
        this.myVendors = this.myVendorsTemp;
      }
    });
  }

  closeModal() {
    this.modalStatus = false;
  }

  ngOnInit() {
    this.api.selectedPageStatus.next({
      title: 'Home',
      searchStatus: true,
      backStatus: false
    }); // var mxConnect = new window.MXConnect({
